import React from 'react';
import ReactDOM from 'react-dom'
import Navbar from '../components/navbar'
import {Helmet} from "react-helmet";
import Footer from '../components/footer'
import ScrollMagic from 'scrollmagic'
import '../pages/styles/treatments.css'
import '../components/styles/buttons.css'
import 'Users/alexlo/Documents/soloesteclinica/my-app/node_modules/scrollmagic/scrollmagic/uncompressed/plugins/animation.gsap'

class Treatments extends React.Component {
    constructor(props) {
        super(props);
        this.controller = new ScrollMagic.Controller();
      }

      componentDidMount() {
        new ScrollMagic.Scene({
          triggerElement: "#scrollStarts",
          duration: 400, // scroll distance
          offset: 200 // start this scene after scrolling for 50px
        })
          .setTween("#myElement", {
            scale: 0.5,
            color: "red"
          })
          .setPin("#myElement") // pins the element for the the scene's duration
          .addTo(this.controller); // assign the scene to the controller
      }
    render(){
    return (

        <React.Fragment>
            <Helmet>

            <title>Tratamientos</title>
            </Helmet>
            <Navbar></Navbar>
            <header id='scrollStarts' className='header-tra'>
                <div id='wrapper'  className="header-info">
                    <h1>Conozca nuestros tratamientos</h1>
                    <hr/>
                    <p>Contamos con una gran variedad de tratamientos</p>
                </div>
                <div className="header-img-tra">
                    <img id='myElement' src={require('./media/handpiece.svg')} alt=""/>
                </div>

            </header>
            <Footer></Footer>
        </React.Fragment>
    )
    }
}

export default Treatments
